import React, { Component } from "react";
import { connect } from "react-redux";
import Button from "@material-ui/core/Button";
import Artists from "./TextFields/Artists";
import Movements from "./TextFields/Movements";
import Centuries from "./TextFields/Centuries";
import Branches from "./TextFields/Branches";
import { fetchStart } from "../Actions/Actions";

class Main extends Component {
  render() {
    return (
      <form onSubmit={() => this.props.dispatch(fetchStart())}>
        <Artists />
        <br />
        <Movements />
        <br />
        <Centuries />
        <br />
        <Branches />

        <Button
          variant="contained"
          color="secondary"
          style={{ position: "relative", bottom: 50 }}
          type="submit"
        >
          Submit
        </Button>
      </form>
    );
  }
}

const mapStateToProps = state => {
  return {
    artist: state.form.artist,
    movement: state.form.movement,
    century: state.form.century,
    branch: state.form.branch
  };
};

const connectedOne = connect(mapStateToProps)(Main);
export default connectedOne;
